import './App.css';
import {Grid, Table, TableBody, TableCell, TableHead, TableRow} from "@material-ui/core";
import React from "react";
import connect from "react-redux/lib/connect/connect";

class App extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<Grid
				xs={12}
				sm={12}
				lg={12}
				md={12}
				item
				container
			>
				<Table>
					<TableHead>
						<TableRow>
							<TableCell>
								ID
							</TableCell>
							<TableCell>
								Name
							</TableCell>
							<TableCell>
								Closed
							</TableCell>
							<TableCell>
								Status
							</TableCell>
							<TableCell>
								CREATE DATE
							</TableCell>
						</TableRow>
					</TableHead>
					<TableBody>
						<TableRow>
							<TableCell>
								ID
							</TableCell>
							<TableCell>
								Name
							</TableCell>
							<TableCell>
								Closed
							</TableCell>
							<TableCell>
								Status
							</TableCell>
							<TableCell>
								CREATE DATE
							</TableCell>
						</TableRow>
					</TableBody>
				</Table>
			</Grid>
		);
	}
}

const mapStateToProps = state => state.TasksStore;


export default connect(mapStateToProps, {})(App);
